import React from 'react';
import styled from 'styled-components';

import RemoteMypage from '../images/remote-mypage.png';
import RemoteLogout from '../images/remote-logout.png';
import RemoteIntro from '../images/remote-intro.png';
import RemoteMak from '../images/remote-mak.png';
import RemoteBrew from '../images/remote-brew.png';

const Nav = () => {
  const remoteMypage = RemoteMypage;
  const remoteLogout = RemoteLogout;
  const remoteIntro = RemoteIntro;
  const remoteMak = RemoteMak;
  const remoteBrew = RemoteBrew;

  return (
    <div>
      <img src={remoteMypage} alt="mypage" />
      <img src={remoteLogout} alt="logout" />
      <img src={remoteIntro} alt="intro" />
      <img src={remoteMak} alt="mak" />
      <img src={remoteBrew} alt="brew" />
    </div>
  );
};

export default Nav;
